function* arrayGenerator(array: any[]): ArrayGenerator {
  for (let index = 0; index < array.length; index++) {
    const currentValue = array[index];
    const generatorTuple: [any, number, any[]] = [currentValue, index, array];
    yield generatorTuple;
  }
}
